    const prevSrc = `${process.env.PUBLIC_URL}/images/${prevBackgroundSrc}.jpg`;
    console.log(nowSrc);

    return (
        <div className="Background">
            <img src={nowSrc}></img>
            <img src={prevSrc}></img>
            {children}
        </div>
    );
};


export default Background;
